import Vue from 'vue'
import VueRouter from 'vue-router'
import SignIn from '../views/SignIn.vue'
import HomePage from '../views/HomePage.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'homepage',
    component: HomePage
  }, {
    path: '/',
    name: 'sign-in',
    component: SignIn
  }
]

const router = new VueRouter({
  routes
})

export default router
